import {API_ENDPOINTS} from "../utils/constants";
function Irasai(props){
    const {loading, data, setData} = useFetch(API_ENDPOINTS.irasas);

    const addIrasas = irasas => {
      setData([...data, irasas])
    };

    return (
        <section className="Irasas">
          <h3>Naujausi blogai</h3>
          {loading ?
            <div>Loading...</div>
            :
            data.map(Item)
          }
          {/* <AddContactForm addContact={addContact}/> */}
        </section>
      );
    }
