             <p>{props.tekstas} </p>
               <button className="formlaukas"  value={props.data.id} onClick={clicked}>Daugiau</button>
             </div>

             {/* <button  value={props.data.id} onClick={clicked}>Delete</button> */}
          </div>
        );
